import React from 'react'
import { withStyles } from "@material-ui/core/styles";
import { green } from "@material-ui/core/colors";
import Checkbox from "@material-ui/core/Checkbox";
import CheckBoxCss from "./CheckBox.scss";
export const CheckBox = props => {
    console.log(props);
    const AnimatedCheckbox = withStyles({
        root: {
          color: CheckBoxCss.Checkbox_unchecked_color,
          "&$checked": {
            color: green[600]
          }
        },
        checked: {}
      })(props => <Checkbox color="default" {...props} />);
    return (
        <li>
        <div className="view">
          <AnimatedCheckbox onClick={props.handleCheckChieldElement} checked={props.isChecked} value="checked" />
          <label>{props.value}</label>
        </div>
      </li>
    )
}

export default CheckBox
